import React from "react";
import PropTypes from "prop-types";
import "./Admin.scss";
Admin.propTypes = {};

function Admin(props) {
  return (
    <div className="Admin">
      <div className="LeftSection">
        <div className="Menu">
          <div className="Logo">
            <img
              src={require("../../../assets/images/logo.png").default}
              alt="Loading..."
            />
          </div>
          <div className="Item">
            <span>Trang chủ</span>
          </div>
          <div className="Item">
            <span>Khách hàng</span>
          </div>
          <div className="Item">
            <span>Sản phẩm</span>
          </div>
        </div>
        <div className="Button">close</div>
      </div>
      <div className="RightSection">s</div>
    </div>
  );
}

export default Admin;
